(15, 'fr', 'PsndDoferi u', 'Estepa, Séville, Espagne', '500 ml', 'Saveurs', 'Au nez les arômes rappellent ceux de l\'ananas et des aiguilles de pin - huile douce.', 'Savoirs', 'Idéale pour cuisiner, rôtir et frire.<br><br>Filtrée', 'Variétés d\'olives', 'Assemblage : variétés hojiblanca', 'ud-ndsreofpi', 17),
(16, 'en', 'PdiDueonrsf ', 'Estepa, Seville, Spain', '500 ml', 'Flavours', 'Green fruity aromas that are reminiscent of pineapple and pine needles - a sweet oil.', 'Flair', 'Ideal for cooking, roasting and frying.<br><br>Filtered', 'Olive varieties', 'Blend: hojiblanca varieties', 'nuordsipfd-e', 17),
(17, 'fr', ' l.521iil-L & vvz e esz ', 'Moli dels Torms, Lleida, Espagne', '2.5 L', 'Saveurs', 'Fruité vert aux arômes de gazon fraîchement coupé avec des notes de pelure de banane et d\'amandes - douce et légèrement poivrée. Savoureuse!', 'Savoirs', 'Elle sait très bien supplanter le beurre sur le pain quotidien! Excellente dans toutes sortes de salades, idéale pour la préparation de vinaigrettes et pour faire une mayonnaise de luxe! Fortement recommandée pour donner une touche spéciale aux plats cuisinés.<br><br>Biologique - Non filtrée', 'Variétés d\'olives', 'Assemblage : arbequina et arbreblanque', 'iv-l-5i1el-2-o-levos', 18),
(18, 'en', 'i zL51 &z.ee -i lv2l  sv', 'Moli dels Torms, Lleida, Spain', '2.5 L', 'Flavours', 'Fruity green with aromas of fresh cut grass and notes of banana peel and almonds - mild and slightly peppery. Fresh and tasty!', 'Flair', 'An ideal replacement for butter on your morning toast! Excellent in all salads, ideal for making vinaigrettes and deluxe mayonnaise! Strongly recommended if you\'re looking for a special touch in your favourite recipe.<br><br>Organic - Unfiltered', 'Olive varieties', 'Blend: arbequina and arbreblanque', '-i2lo--5-vle-soevli1', 18),
(19, 'fr', 'slz-8vevzl0 i   50ie &', 'Estepa, Séville, Espagne', '500 ml', 'Saveurs', 'Fruité intense dominé par des arômes de tomates fraîches - bel équilibre entre l\'amertume et le piquant en finale.', 'Savoirs', 'Idéale avec salades, poisson, légumes et viandes grillées.<br><br>Filtrée - D.O.P. Estepa', 'Variétés d\'olives', 'Monovariétale : hojiblanca', 'e-oi80-v0l-volesi5', 19),
(20, 'en', ' i  &ls le0vv i08z5z-e', 'Estepa, Seville, Spain', '500 ml', 'Flavours', 'Intense fruitiness with fresh tomato aromas - a nice balance between spiciness and bitterness.', 'Flair', 'Ideal with salads, fish, grilled meats and veggies.<br><br>Filtered - D.O.P. Estepa', 'Olive varieties', 'Monovarietal: hojiblanca', 'so5o8ie0-vi0v-el-l', 19),
(21, 'fr', 'Boeomor', 'La Rambla, Cordoue, Espagne', '500 ml', 'Saveurs', 'Huile douce et légère au fruité mûr avec une finale légèrement poivrée.', 'Savoirs', 'Idéale en vinaigrette et pour cuisiner au quotidien, son usage est multiple.<br><br>Filtrée', 'Variétés d\'olives', 'Assemblage : hojiblanca, picual et picudo', 'oreobmo', 20),
(22, 'en', 'reooBmo', 'La Rambla, Cordoba, Spain', '500 ml', 'Flavours', 'Mild and fruity, this oil has a light peppery aftertaste.', 'Flair', 'Ideal in vinaigrettes and for daily cooking – a versatile oil.<br><br>Filtered', 'Olive varieties', 'Blend: hojiblanca, picual and picudo', 'oroemob', 20),
(31, 'fr', 'moL-rano ad  eraacCCie', 'Modène, Italie', '210 g', 'Saveurs', 'Combinant harmonieusement le fin balsamique à des arômes tout naturels, ce nectar est un délicieux assemblage de tradition et de modernisme.', 'Savoirs', 'Apporte une touche de classe fantaisiste autant aux plats salés que sucrés, des viandes jusqu\'à la crème glacée.', '', '', 'rcaoliraanoeac--cmde', 35),
(32, 'en', 'rLac- C eemadr iCoaoon', 'Modena, Italy', '210 g', 'Flavours', 'Harmoniously combining fine balsamic to all natural aromas, this nectar is a delicious blend of tradition and modernism.', 'Flair', 'Add a touch of class to both savory and sweet foods, meat to ice cream.', '', '', 'ercm-dcoaoioalrec-na', 35),
(33, 'fr', 'gvginuon sn 0de bSVt-  riea2Cia5a rrroneeeT', 'Cordoue, Andalousie, Espagne', '250 ml', 'Saveurs', 'Il est de couleur rouge foncé avec des reflets rouge brique et dispose d\'un arôme intense de pain grillé et de confiture.', 'Savoirs', 'Ce vinaigre si particulier est obtenu à partir de nos vins rouges de Cabernet Sauvignon, élevé dans nos fonds de cuve acétiques. Il est vieilli en barriques de chêne pendant 12 mois, et acquiert ainsi ses qualités exceptionnelles.<br><br>Idéal pour déglacer des sauces ou faire des assaisonnements.', '', '', 'ndrcvag-rittri0iobeneaaon-se2-g-vurees-n5', 36),
(34, 'en', ' -negSv  urosbngiaaeVe era02itn5rrTno C', 'Cordoba, Andalusia, Spain', '250 ml', 'Flavours', 'It is dark red in colour with brick-red tinges and has a notable, intense aroma of toast and marmalade.', 'Flair', 'This unique vinegar is obtained from red Cabernet Sauvignon grapes, raised in acetic drums, then aged in oak barrels for 12 months... an exceptional vinegar.<br><br>Ideal for deglazing sauces or making seasonings.', '', '', 'serot-rg-atu2nas-bio0nenvnr5va-cieerg', 36),
(35, 'fr', 'abanllcojioHe  atspeze-', 'Estepa, Séville, Espagne', '500 ml', 'Saveurs', 'Une huile d\'un fruité vert aux notes de feuilles et de tomates fraîches -<br>modérément amère et piquante.', 'Savoirs', 'Une huile onctueuse qui se prête aux salades et aux légumes grillés.<br><br>A.P.I. - Filtrée - D.O.P. Estepa', 'Variétés d\'olives', 'Monovariétale : hojiblanca', 'isoe-baloaloepjehnact', 37),
(36, 'en', 'o ilabpjt osnaeeHlzae-c', 'Estepa, Seville, Spain', '500 ml', 'Flavours', 'Fruity olive oil with notes of green leaves and fresh tomatoes - moderately bitter and pungent.', 'Flair', 'A velvety oil that\'s ideal for salads and grilled vegetables.<br><br>A.P.I. - Filtered - D.O.P. Estepa', 'Olive varieties', 'Monovarietal: hojiblanca', 'ooaet-seoepicbjanlhla', 37),
(37, 'fr', ' rndz e4oiiLra', 'Modène, Italie', '250 ml', 'Saveurs', 'Noir brillant avec des rayons jaunes et de densité moyenne, ce balsamique a des arômes subtils d\'aigre-doux avec des notes boisées et des saveurs fruitées. Agréablement doux, légèrement acidulé', 'Savoirs', 'Pour rehausser les légumes cuits sur la braise, grillés ou simplement cuits, le saumon fumé, la pizza, les risottos, les viandes rôties ou grillées, les poissons, les fromages, les salades de fruits, les yogourts et la crème glacée.', '', '', 'da-4rnr-ioelio', 38),
(38, 'en', 'en ra doizirL4', 'Modena, Italy', '250 ml', 'Flavours', 'With bright yellow rays and a good syrupy density, this balsamic vinegar is pleasantly sweet, slightly sour, with velvety fruity flavours of cooked grape must and woody notes.', 'Flair', 'This balsamic vinegar is ideal on mixed salads, raw or cooked vegetables, grilled and boiled meat, fish, vinaigrette, sauces, eggs, potatoes.', '', '', 'i4-eonroidl-ra', 38),
(45, 'fr', 'soprr air-Aee nFe', 'Région de Xérès, Cadix, Espagne', '250 ml', '', '', 'Savoirs', 'Le moût est obtenu à partir de jus de raisin cuit avant la fermentation dans une chaudière en acier inoxydable. 100% moût de raisins sans fermentation, 0% alcool.<br><br>Il est idéal pour l\'assaisonnement, les desserts, la crème glacée et les ragoûts aigre-doux ainsi que pour garnir les plats. Il enrichit toute les sauce en leur donnant une touche de couleur et de goût aigre-doux. D\'ailleurs, quelques gouttes de ce condiment suffisent à améliorer n\'importe quel plat.', '', '', 'rianprrofe-esae', 45),
(46, 'en', '- ienrFsAoper ear', 'Jerez region, Cadix, Spain', '250 ml', '', '', 'Flair', 'Must is obtained from a thorough cook of grape juice before fermentation in a stainless steel boiler. 100% grape must without fermentation, 0% alcohol.<br><br>It is ideal for seasoning, desserts, ice cream and sweet & sour stews as well as for garnish dishes. It enriches any sauce, giving a touch of colour and overall sweet and sour taste. Besides, just a few drop condiment and enhance any dish.', '', '', 'aerneo-spriearf', 45),
(51, 'fr', ' 5zv ii ze00  v1lle&-s', 'Moli dels Torms, Lleida, Espagne', '500 ml', 'Saveurs', 'Fruité vert aux arômes de gazon fraîchement coupé avec des notes de pelure de banane et d\'amandes - douce et légèrement poivrée. Savoureuse!', 'Savoirs', 'Elle sait très bien supplanter le beurre sur le pain quotidien! Excellente dans toutes sortes de salades, idéale pour la préparation de vinaigrettes et pour faire une mayonnaise de luxe! Fortement recommandée pour donner une touche spéciale aux plats cuisinés.<br><br>Biologique - Non filtrée', 'Variétés d\'olives', 'Assemblage : arbequina et arbreblanque', '-00le5v-vol-1iieos', 49),
(52, 'en', '0i lze1  z0isv5-v &el ', 'Moli dels Torms, Lleida, Spain', '500 ml', 'Flavours', 'Fruity green with aromas of fresh cut grass and notes of banana peel and almonds - mild and slightly peppery. Fresh and tasty!', 'Flair', 'An ideal replacement for butter on your morning toast! Excellent in all salads, ideal for making vinaigrettes and deluxe mayonnaise! Strongly recommended if you\'re looking for a special touch in your favourite recipe.<br><br>Organic - Unfiltered', 'Olive varieties', 'Blend: arbequina and arbreblanque', 'vi-vioeo-sl05le0-1', 49),
(55, 'fr', 'rnrlScebuTAioi   onerqea-si', 'Vilafranca del Penedès, Barcelone,  Espagne', '500 ml', 'Saveurs', 'Silencio porte la signature de la maison Torres qui produit cette huile aux arômes de gazon vert, de tomate et d\'amande avec une finale au piquant agréable.', 'Savoirs', 'Avec les poissons, salades, légumes vapeur et le chocolat noir. <br><br>Filtrée', 'Variétés d\'olives', 'Monovariétale : arbequina', 'aoocliuqi-ressnrratibeen-', 51),
(56, 'en', 'cAanqnTioeserri rS ubi e-lo', 'Vilafranca del Penedès, Barcelona,  Spain', '500 ml', 'Flavours', 'Silencio bears the Torres signature who produce this intense fruity oil. Aromas of fresh grass, tomato and almond and a pleasant spicy aftertaste.', 'Flair', 'Try it on fish, salads, steamed vegetables and dark chocolate. <br><br>Filtered', 'Olive varieties', 'Monovarietal: arbequina', 'eselrrautni-cbirinqoo-ase', 51),
(57, 'fr', 'at0-uFne an5B  0ee', 'Baena, Cordoue, Espagne', '500 ml', 'Saveurs', 'Arômes d\'agrumes qui évoquent le pamplemousse rose, fruité moyen se terminant sur une note légèrement piquante.', 'Savoirs', 'Pour les pâtes au parmesan, fruits de mer, poisson et petites fritures. Pain grillé du matin avec sirop d\'érable, miel ou compote de fruits, salades traditionnelles et d\'agrumes.<br><br>Non filtrée - D.O.P. Baena', 'Variétés d\'olives', 'Assemblage : picudo, hojiblanca et picual', 'aen-nb05eeu0tf-a', 52),
(58, 'en', 'e5nt eFe-a0B 0uan ', 'Baena, Cordoba, Spain', '500 ml', 'Flavours', 'This medium fruity oil has citrus aromas reminiscent of pink grapefruit, and a slightly spicy finish.', 'Flair', 'For Parmesan pasta, seafood, fish and fried foods. Try it on your morning toast with maple syrup, honey or fruit compote, or on a green or fruit salad. <br><br>Unfiltered - D.O.P. Baena', 'Olive varieties', 'Blend: picudo, hojiblanca and picual', 'ae0-fbe5-netu0an', 52),
(59, 'fr', '0-0atraSMaat 5 n ', 'Santa Marta de los Barros, Badajoz, Espagne', '500 ml', 'Saveurs', 'Fruité mûr avec des notes de pomme rappelant les fruits secs tels que les amandes et les noix. Une légère amertume et des touches plus relevées qui apportent vivacité et persistance à l\'huile. Un bel équilibre.', 'Savoirs', 'Excellent produit pour la cuisine de tous les jours.<br><br>Filtrée', 'Variétés d\'olives', 'Assemblage : morisca et carrasqueña', 'ar5-t-an0at0sma', 53),
(60, 'en', '  ra atS0Maat-05n', 'Santa Marta de los Barros, Badajoz, Spain', '500 ml', 'Flavours', 'Very well balanced extra virgin olive oil with medium fruity aromas that are reminiscent of apples, dried fruits and almonds. It has a slight bitterness and a spicy note that give the oil its vivacity. A nice balance.', 'Flair', 'Excellent for everyday use.<br><br>Filtered', 'Olive varieties', 'Blend: morisca and carrasqueña', '05-ra0tams-aant', 53),
(65, 'fr', 'ls nivteoive-rz   2&c lzi', 'Estrémadure, Espagne', '250 ml', 'Saveurs', 'Olives manzanillas farcies à la pâte de citron.', 'Savoirs', 'Idéales pour servir tel quel avec l\'apéro et les tapas et pour ajouter au martini sec, dans les salades, avec les poissons à chair blanche, le poulet et le lapin cuisinés.', 'Conseil', 'Se conservent dans le garde-manger et peuvent être rafraîchies au frigo durant une demie heure avant de servir.', 'ioverive-o2lsn-ctoi-l', 56),
(66, 'en', 'vilzmvi2-le  e&zn  os le', 'Extremadura, Spain', '250 ml', 'Flavours', 'Manzanilla olives stuffed with lemon paste.', 'Flair', 'Ideal served as is, with an aperitif or tapas. In a dry martini, a salad, with white fish, chicken or rabbit.', 'Advice', 'Keep in a cupboard pantry then chill in the fridge for half an hour before serving.', 'n2si-ovei-vomelleol-', 56),
