(68, 'en', ' nii-ozvclevhva i z&e ls4se ', 'Extremadura, Spain', '250 ml', 'Flavours', 'Manzanilla olives stuffed with anchovie paste.', 'Flair', 'Ideal served as is, with an aperitif or tapas. Add a touch to your favorite recipes and salads.', 'Advice', 'Keep in a cupboard pantry then chill in the fridge for half an hour before serving.', 'isaovevec-i-oivleh4s-oln', 57),
