(74, 'en', 'ize&eli evrp sv5rdeep z pl-  ', 'Extremadura, Spain', '250 ml', 'Flavours', 'Manzanilla olives stuffed with red pepper paste.', 'Flair', 'Their mellow, slightly salty flavour is perfect for tomato sauces, tartars or as a pizza topping.', 'Advice', 'Keep in a cupboard pantry then chill in the fridge for half an hour before serving.', '-ied--rp-opieprveveseoll5', 60),
