(78, 'en', ' iv1 G te l pWza&-s ifdevlpzier', 'Moli dels Torms, Lleida, Spain', '500 ml', 'Flavours', 'Fruity green with aromas of fresh cut grass and notes of banana peel and almonds - mild and slightly peppery. Fresh and tasty!', 'Flair', 'An ideal replacement for butter on your morning toast! Excellent in all salads, ideal for making vinaigrettes and deluxe mayonnaise! Strongly recommended if you\'re looking for a special touch in your favourite recipe.<br><br>Organic - Unfiltered', 'Olive varieties', 'Blend: arbequina and arbreblanque', 'vrg-o1-pwisloeit-faedviel-p', 62),
(79, 'fr', 'El-caotx BiooVcetcrAcm ehi  aas', 'Modène, Italie', '100 ml', '', '', 'Savoirs', 'C\'est un produit unique au monde, garanti par le Consortium des Producteurs qui contrôle sévèrement non seulement la filière de production, mais qui intervient également pour vérifier la fiabilité des caractéristiques organoleptiques et tester la qualité à travers le jugement de goûteurs experts. Les consommateurs sont ainsi assurés de la qualité du produit et du vieillissement.<br><br>Vieillissement de plus de 25 ans', '', '', 'extmaoi-bithc-saalcre-vaccoeo', 63),
(80, 'en', ' c ltamEic c-sao VeBcxiAtoaerho', 'Modena, Italy', '100 ml', '', '', 'Flair', 'It is a unique product, guaranteed by Consortium of Producers that not only strictly controls the production process but also verifies the reliability of the vinegar\'s organoleptic properties and tests its quality by means of the judgement of expert tasters. Thus, consumers can be assured of the quality and the years of aging.<br><br>Aged more than 25 years', '', '', 'l-oatbseieaaom-xectcac-rciovh', 63),
(81, 'fr', 'oi- lAnsafcmAeoBatt  ficoa', 'Modène, Italie', '100 ml', 'Saveurs', 'Possède un bouquet caractéristique, parfumé, complexe, bien amalgamé, pénétrant, d\'une acidité évidente, mais agréable et harmonieuse. Manifeste sa propre densité par un aspect sirupeux et fluide. Le goût caractéristique du vinaigre balsamique découle à la foisd\'une douceur et d\'une aigreur bien équilibrées, avec une acidité appréciable et un léger reflet aromatique obtenu sous l\'influence des différents bois utilisés pour les récipients de la vinaigrerie, vif, franc, plein, velouté, intense et persistant, en parfaite harmonie avec les caractères olfactifs qui le caractérisent.', 'Savoirs', 'Il s\'agit d\'un produit obtenu à partir du moût du raisin cuit, mûri par une acétification lente, dérivée d\'une fermentation naturelle et d\'une concentration progressive gâce à un long vieillissement, sans aucune adjonction de substances aromatiques.<br><br>Vieillissement de plus de 12 ans', '', '', '-alsoaomiafaictb-enfcota', 64),
(82, 'en', 'mctatf fo-oniBiolAsa aAc e', 'Modena, Italy', '100 ml', 'Flavours', 'It possesses a characteristic bouquet: aromatic, complex, well blended, penetrating, with obvious acidity, but pleasant and harmonious. The fluid is dense and syrupy. The characteristic taste of balsamic vinegar results from well-balanced sweetness and sourness, with appreciable acidity and a slight aromatic sparkle due to the influence of the different woods used for vinegar-making containers: lively, robust, full, mellow, intense and persistent, in perfect harmony with its characteristic olfactory qualities.', 'Flair', 'This is a product obtained from cooked grape must, matured by gradual acetification, derived from natural fermentation and gradual concentration due to its long aging, without any flavorings being added.<br><br>Aged more than 12 years', '', '', 'tfbo-cfoamasnetaiolcaai-', 64),
(83, 'fr', ' n7aueFt5B ee- a0n', 'Baena, Cordoue, Espagne', '750 ml', 'Saveurs', 'Arômes d\'agrumes qui évoquent le pamplemousse rose, fruité moyen se terminant sur une note légèrement piquante.', 'Savoirs', 'Pour les pâtes au parmesan, fruits de mer, poisson et petites fritures. Pain grillé du matin avec sirop d\'érable, miel ou compote de fruits, salades traditionnelles et d\'agrumes.<br><br>Non filtrée - D.O.P. Baena', 'Variétés d\'olives', 'Assemblage : picudo, hojiblanca et picual', 'ae-e-0beaun7nft5', 65),
(84, 'en', '057-ean aFBn e uet', 'Baena, Cordoba, Spain', '750 ml', 'Flavours', 'This medium fruity oil has citrus aromas reminiscent of pink grapefruit, and a slightly spicy finish.', 'Flair', 'For Parmesan pasta, seafood, fish and fried foods. Try it on your morning toast with maple syrup, honey or fruit compote, or on a green or fruit salad.<br><br>Unfiltered - D.O.P. Baena', 'Olive varieties', 'Blend: picudo, hojiblanca and picual', '7n0afae5b-e-eutn', 65),
(85, 'fr', 'noSLearnad ', 'La Rambla, Cordoue, Espagne', '500 ml', 'Saveurs', 'Sa saveur rappelle les olives fraîchement cueillies - huile fruitée, très douce au goût avec une finale légèrement poivrée.', 'Savoirs', 'En salades, sur les plats cuisinés et variés.<br><br>Filtrée', 'Variétés d\'olives', 'Assemblage : hojiblanca, picual, picudo et léchin de Séville', 'asonanld-er', 66),
(86, 'en', ' raLdnoeSan', 'La Rambla, Cordoba, Spain', '500 ml', 'Flavours', 'Mild with a slightly peppery finish and a distinctive aromatic flavour that captures the essence of freshly picked olives.', 'Flair', 'For salads, cooked dishes and more.<br><br>Filtered', 'Olive varieties', 'Blend: hojiblanca, picual, picudo and lechin de Sevilla', 'aesdnro-nla', 66),
(87, 'fr', 'dLaiinnB-o  a looSeqguer', 'La Rambla, Cordoue, Espagne', '500 ml', 'Saveurs', 'Cultivées selon les normes biologiques, les olives de cette huile présentent une note plus aromatique et poivrée que celles de son homologue classique.', 'Savoirs', 'Idéale sur les pâtes et salades, pour faire griller les légumes, cuire le poisson et remplacer le beurre dans la purée de pommes de terre.<br><br>Biologique - Filtrée', 'Variétés d\'olives', 'Assemblage : hojiblanca, picual, picudo et léchin de Séville', 'abqluoearn-lnosdoiig-e', 67),
(88, 'en', 'crSnaaei  nLgz-r ndoa', 'La Rambla, Cordoba, Spain', '500 ml', 'Flavours', 'Harvested in the organic olive grove, this oil has more intensity and peppery aftertaste than its classic sister oil San Leandro!', 'Flair', 'Try it on salads, pasta or fish, use it while grilling vegetables or as a replacement for butter in mashed potatoes!<br><br>Organic - Filtered', 'Olive varieties', 'Blend: hojiblanca, picual, picudo and lechin de Sevilla', 'nagraliaedonn-r-osc', 67),
(89, 'fr', 'reNtca', 'La Rambla, Cordoue, Espagne', '500 ml', 'Saveurs', 'Le parfum d\'olives fraîches de cette huile provient d\'un assemblage exécuté avec grand soin par le maître de la maison. Très douce et onctueuse.', 'Savoirs', 'Un délice sur votre plat préféré et excellente avec le homard pour remplacer le beurre! <br><br>Non filtrée', 'Variétés d\'olives', 'Assemblage : picudo, hojiblanca, picual et léchin', 'natcer', 68),
(90, 'en', 'ctNear', 'La Rambla, Cordoba, Spain', '500 ml', 'Flavours', 'The perfume of fresh olives in this oil comes from a crafted blend executed with great care by the the master taster. A sweet and smooth oil.', 'Flair', 'A real delight on most dishes and an excellent alternative to butter on lobster.<br><br>Unfiltered', 'Olive varieties', 'Blend: picudo, hojiblanca, picual and lechin', 'acernt', 68),
(91, 'fr', 'e .lVb siq.inarc m -aueoauBiiGoggnbqlelbia ', 'Modène, Italie', '250 ml', 'Saveurs', 'Saveur aigre-douce. Bien équilibré. Acidité délicate.', 'Savoirs', 'À substituer au vin blanc et au jus de citron. Sa couleur dorée permet au plat de conserver son aspect naturel.<br><br>Certifié ICEA', '', '', 'amsbblv-iu-neqllucii-qiagooeie-brnagagb-', 69),
(92, 'en', 'h.n Wloe  ramsGbig catineiaB .i-crgav', 'Modena, Italy', '250 ml', 'Flavours', 'Sweet-and-sour flavor. Well balanced. Delicate acidity.', 'Flair', 'Can be substituted for white wine or lemon juice. Its golden hue means light-colored foods look natural.<br><br>ICEA certified', '', '', 'strnagagl-geaoiw-b-bihicrav-nicem-', 69),
(93, 'fr', '  oP-TrVleaaegrneerri sia dald', 'Cordoue, Andalousie, Espagne', '250 ml', 'Saveurs', 'Il propose des arômes fins de fleurs sauvages, est riche en fruits (coings, confiture de prunes, pommes \'Reinata\') et des saveurs grillées dû au vieillissement. Il est doux au palais avec un équilibre parfait entre l\'acidité et le côté sucré.', 'Savoirs', 'Ce vinaigre si particulier est obtenu à partir de nos vins blancs de la variété Parellada. Après une sélection minutieuse, il est vieilli en barriques de chêne pendant 12 mois, où il acquiert ses qualités exceptionnelles.<br><br>Parfait pour les marinades de viandes ou poissons. Idéal pour les vinaigrettes et pour déglacer des sauces.', '', '', 'v-drearpiaoseaeeagrnil--lrtd', 70),
(94, 'en', ' llrTniresegdeoVa a r-Paar', 'Cordoba, Andalusia, Spain', '250 ml', 'Flavours', 'It offers fine aromas of wild flowers, is rich in fruit (quince, plum jam, ‘Reinata\' apples) and has toasty nuances from the ageing. It is smooth on the palate with perfect balance between acidity and sweetness.', 'Flair', 'This exquisite vinegar is made from white Parellada grapes. Following a strict selection process, the vinegar is aged in oak barrels for 12 months where its taste matures and deepens.<br><br>Perfect for marinating meat or fish. Ideal for vinaigrettes and deglazing sauces.', '', '', '-drrla-lenaproegvasteira', 70),
(95, 'fr', 'oc eltseaieS -lzpenóce', 'Estepa, Séville, Espagne', '500 ml', 'Saveurs', 'Issue d\'une combinaison de deux fruits, Selección est une huile fruitée et équilibrée entre son amertume et le piquant en bouche.', 'Savoirs', 'Un excellent rapport qualité-prix pour la cuisine de tous les jours.<br><br>A.P.I. - Filtrée - D.O.P. Estepa', 'Variétés d\'olives', 'Assemblage : arbequina et hojiblanca', 'eoosptellaeseconiec-', 71),
(96, 'en', 'eiteezeln Scoe -ólsacp', 'Estepa, Seville, Spain', '500 ml', 'Flavours', 'Made from a blend of two different fruits, this extra virgin olive oil is fruity and well balanced with a bitter and spicy aftertaste.', 'Flair', 'An excellent value, perfect for everyday cooking.<br><br>A.P.I. - Filtered - D.O.P. Estepa', 'Olive varieties', 'Blend: arbequina and hojiblanca', 'sonlteieapcclsoe-eoe', 71),
(97, 'fr', '-Tub g psVEoirenet a', 'Estepa, Séville, Espagne', '750 ml', 'Saveurs', 'Issue des premières récoltes de la saison, cette huile dégage un parfum intense fruité vert aux notes d\'amandes vertes.', 'Savoirs', 'Une huile de dégustation qui plaît tant aux amateurs qu\'aux connaisseurs. <br><br>Non filtrée - D.O.P. Estepa', 'Variétés d\'olives', 'Assemblage : arbequina, hojiblanca, manzanilla et lechin', 'pvsrbeeguno-ietat-', 72),
(98, 'en', 'bia  -VuEnesTor petg', 'Estepa, Seville, Spain', '750 ml', 'Flavours', 'Made from the first harvest of the season, Estepa Virgen has an intense fruity green perfume with green almonds notes.', 'Flair', 'An ideal tasting oil that pleases connoisseurs and neophytes alike.<br><br>Unfiltered - D.O.P. Estepa', 'Olive varieties', 'Blend: arbequina, hojiblanca, manzanilla and lechin', 'n--beertsovaeutipg', 72),
(99, 'fr', 'Arte  p-enslueazaeboqi', 'Estepa, Séville, Espagne', '500 ml', 'Saveurs', 'Cette huile fruitée rappelle le parfum de tomate verte et de roquette - en bouche elle laisse un léger goût d\'amandes vertes.', 'Savoirs', 'Une huile de finition ainsi que pour petites cuissons rapides.<br><br>A.P.I. - Non filtrée - D.O.P. Estepa', 'Variétés d\'olives', 'Monovariétale : arbequina', 'qbtaap-eooeluneieras', 73),
(100, 'en', 'q sbeAzouteaee-iarlp n', 'Estepa, Seville, Spain', '500 ml', 'Flavours', 'This arbequina oil has aromas of green tomato and arugula. It is light tasting and leaves a green almond aftertaste.', 'Flair', 'A good oil for finishing or quick cooking.<br><br>A.P.I. - Unfiltered - D.O.P. Estepa', 'Olive varieties', 'Monovarietal: arbequina', 'lseeeueo-qantoarpbia', 73),
