(105, 'fr', 'l-ioiscBe a Broom', 'Cordoue, Andalousie, Espagne', '250 ml', 'Saveurs', 'La saveur est fraîche et authentique.', 'Savoirs', 'Cette huile aromatisée Boromeo est produite avec des huiles essentielles, provenant d\'une distillation naturelle et non pas par extraction chimique. Les plantes sont cueillies à leur pleine maturité et ensuite séchées pour parfumer, épicer ou assaisonner tous vos plats.<br><br>Se prête aux soupes, salades de tomates, pâtes et à la cuisine asiatique.', 'Variétés d\'olives', 'Assemblage : hojiblanca, picual, picudo et huiles essentielles', 'miblsar-ocboeio', 76),
(106, 'en', '-oBeloaBo  simr', 'Cordoba, Andalusia, Spain', '250 ml', 'Flavours', 'The taste is fresh and authentic.', 'Flair', 'This flavored Boromeo oils is produced with essential oils obtained by natural distillation; not by chemical extraction. Picked when fully mature, the plants are dried to add flavor, spice or season your dish.<br><br>Delightful in soups, tomato salads, pasta and Asian recipes.', 'Olive varieties', 'Blend: hojiblanca, picual, picudo and essential oils', 'osmoaobreil-b', 76),
