(111, 'fr', 'euadslei eAe bbQ', 'Monteagudo, Navarre, Espagne', '500 ml', 'Saveurs', 'Arômes rappelant la pelure de banane et l\'olive douce. En bouche, elle est une huile sensuelle dont on appréciera toute la complexité. Grand cru du terroir espagnol.', 'Savoirs', 'Sur les poissons, les légumes, les salades, le fromage de chèvre et parfaite pour accompagner le chocolat noir fondu.<br><br>Non filtrée', 'Variétés d\'olives', 'Monovariétale : arbequina', 'eiesbuadeabl-qe-', 79),
