(113, 'fr', 'onraTagr', 'Les Borges Blanques, Lleida, Espagne', '500 ml', 'Saveurs', 'Créée à partir d\'une variété d\'olives qui domine le Domaine Mas del Senyor, Tagornar se démarque par son parfum et son fruité doux.', 'Savoirs', 'Ce domaine est au coeur de magnifiques paysages dont les sols sont arides et exposés au gel d\'hiver et aux étés très secs. Cet environnement contribue à produire le caractère unique de ce produit.<br><br>Non filtrée', 'Variétés d\'olives', 'Assemblage : arbequina et verdiell', 'rgtronaa', 80),
(114, 'en', 'naorgraT', 'Les Borges Blanques, Lleida, Spain', '500 ml', 'Flavours', 'Made from a variety of olives that grow on the Mas del Senyor estate, Tagornar is characterised by its sweet and fruity taste.', 'Flair', 'This magnificent estate is surrounded by beautiful landscapes with an arid soil that is often exposed to freezing winters and dry summers. This environment helps produce the uniqueness of this product.<br><br>Unfiltered', 'Olive varieties', 'Blend: arbequina and verdiell', 'goartanr', 80),
