(127, 'fr', 'Pa i 0taarrc-Gcc eo3', 'Modène, Italie', '50 ml', 'Saveurs', 'Goût de confiture de figue et léger goût de vanille dû au baril de bois de chêne.', 'Savoirs', 'Les vinaigres balsamiques \"Gocce di Modena\" sont des produits purs et authentiques, sans colorants ni agents conservateurs; pur fruit du temps qui s\'écoule lentement.<br><br>Idéal sur: saumon fumé, risotto, viandes bouillies ou grillées, pomme de terre bouillie, caviar, foie gras, fromages vieillis, salami et jambon, crème glacée à la vanille, yogourt, salade de fruits, fraises, chocolats fondant. En digestif, dégustez-le à la cuillère.', '', '', 'eacc3t-opia-crga0r', 87),
