(129, 'fr', 'c-o 0ter gA oGe5cn', 'Modène, Italie', '50 ml', 'Saveurs', 'Saveur délicate de moût de raisin trebbiano cuit et parfum boisé.', 'Savoirs', 'Les vinaigres balsamiques “Gocce di Modena” sont des produits purs et authentiques, sans colorants ni agents conservateurs; pur fruit du temps qui s\'écoule lentement.<br><br>Idéal sur: saumon fumé, risotto, viandes bouillies ou grillées, pomme de terre bouillie, caviar, foie gras, fromages vieillis, crème glacée à la vanille, yogourt, fraises. En digestif, dégustez-le à la cuillère.', '', '', 'go-cceg0rten-oa5', 88),
(130, 'en', 'onGr ceo5t0- A gce', 'Modena, Italy', '50 ml', 'Flavours', 'The delicate flavor of cooked grape must, with a woody aroma.', 'Flair', 'The balsamic vinegars \"Gocce di Modena\" are pure and authentic products, no dyes or preservatives.<br><br>Ideal on: smoked salmon, risotto, roast or grilled meats, boiled potatoes, fish, caviar, foie gras, mature cheese, vanilla ice cream, yogurt, strawberries. A teaspoon at the end of a meal as digestive.', '', '', 'cae-n5tge0cor-go', 88),
(131, 'fr', '0  ra0ees1GciGRnvc a- or', 'Modène, Italie', '50 ml', 'Saveurs', 'Parfum des différentes essence de bois dans lequel il a vieilli (chêne, noisetier, cerisier, frêne et mûrier).', 'Savoirs', 'Les vinaigres balsamiques “Gocce di Modena” sont des produits purs et authentiques, sans colorants ni agents conservateurs; pur fruit du temps qui s\'écoule lentement.<br><br>Idéal sur: saumon fumé, risotto, viandes bouillies ou grillées, pomme de terre bouillie, caviar, foie gras, fromages vieillis, crème glacée à la vanille, yogourt, fraises. En digestif, dégustez-le à la cuillère.', '', '', 'ga0rogea1sre-rcnvi--c0', 89),
(132, 'en', 'iG-an0oee1G Rc sacrvr0  ', 'Modena, Italy', '50 ml', 'Flavours', 'The aroma of the different woods in which it was aged (oak, hazelnut, cherry, ash and mulberry).', 'Flair', 'The balsamic vinegars \"Gocce di Modena\" are pure and authentic products, no dyes or preservatives.<br><br>Ideal on: smoked salmon, risotto, roast or grilled meats, boiled potatoes, fish, caviar, foie gras, mature cheese, vanilla ice cream, yogurt, strawberries. A teaspoon at the end of a meal as digestive.', '', '', 'gn-a0rsicco1ae--vegr0r', 89),
(133, 'fr', 'eroL3r  inaizd', 'Modène, Italie', '250 ml', 'Saveurs', 'Agréablement doux, légèrement acidulé, avec des saveurs fruitées et veloutées, de moût de raisin cuit, des notes boisées avec des saveurs de moût de raisin cuit Trebbiano. Noir brillant avec des rayons jaunes et une densité sirupeuse. Son arôme a un côté subtil d\'aigre-doux', 'Savoirs', 'Idéal sur les salades, les légumes aussi bien crus que cuits, les viandes grillées blanches ou rouges, les omelettes, les fromages, les poisons pochés ou grillés, les salades de fruits.', '', '', 'danroiio3-e-lr', 90),
(134, 'en', 'a zi3Lerond ir', 'Modena, Italy', '250 ml', 'Flavours', 'Pleasantly sweet and slightly sour, with flavours of Trebbiano cooked grape must. Dark with bright yellow rays and a medium density.', 'Flair', 'This Balsamic Vinegar is ideal on mixed salads, raw or cooked vegetables, grilled white and red meat, omelette, cheese, poached and grilles fish and fruit salads.', '', '', 'ioenadl--irro3', 90),
(135, 'fr', 'oilenNzrLei brad oo', 'Modène, Italie', '250 ml', '', '', 'Savoirs', 'Ce vinaigre est obtenu à partir de moût de raisins blancs acétifié et fermenté dans des tonneaux de Rouvre (chêne) de façon à ce qu\'il prenne une couleur jaune-or. La caractéristique la plus évidente de ce vinaigre est qu\'il ne modifie pas la couleur des mets et offre des arômes et des saveurs fruités délicatement acides (remplace à merveille le vinaigre de vin).<br><br>Excellent avec les salades, les légumes aussi bien crus que cuits, les sauces, les poissons, les viandes blanches, les fromages (mozzarella de buffalonne, Bitto, scamorza et robiola) et dans la préparation d\'apéritifs.', '', '', 'oeroob--nllianiedor', 91),
(136, 'en', ' lozLrdi braoeioNne', 'Modena, Italy', '250 ml', '', '', 'Flair', 'It is produced using white grape must, which is acetified and matured in oak barrels. It has a typical yellow-gold colour. Its most striking feature is that it does not alter the colour of dishes but adds a fruity and mildly acid aroma and flavour (excellent in place of wine vinegar).<br><br>Ideal on: salad, raw and cooked vegetables, sauces, fish, white meat (chicken and turkey), cheese (buffalo Mozzarella, Bitto, Scamorza and Robiola), for aperitifs.', '', '', 'broioieol--alndoner', 91),
(137, 'fr', ' tniimcoeare  -ii manhe rLdPlC', 'Modène, Italie', '210 g', 'Saveurs', 'Combinant harmonieusement le fin balsamique à des arômes tout naturels, ce nectar est un délicieux assemblage de tradition et de modernisme.', 'Savoirs', 'Apporte une touche de classe fantaisiste autant aux plats salés que sucrés, des viandes jusqu\'à la crème glacée.', '', '', 'aiiecpemr-coa-ilienndhl-rtm', 92),
