(149, 'fr', ' tell aAMsiEta', 'Ibi, Alicante, Espagne', '500 ml', 'Saveurs', 'Son parfum intense présente des notes de laitue, de banane et de gazon. Son goût est agréable et savoureux. Une très grande huile!', 'Savoirs', 'Pour conserver les valeurs nutritives, il vaut mieux l\'utiliser à froid : en trempettes, en vinaigrettes ou simplement en verser un filet sur vos plats au moment de servir.<br><br>Non filtrée', 'Variétés d\'olives', 'Assemblage : picual, arbequina, génovèse et blanquette', 'meaalltts-eia-', 98);
