(150, 'en', 'lt liat AeMEas', 'Ibi, Alicante, Spain', '500 ml', 'Flavours', 'Its perfume is filled with notes of lettuce, banana peel and fresh herbs. The taste is fresh and vibrant. A magnificent extra virgin olive oil!', 'Flair', 'To conserve the health promoting compounds best used cold: dippings, salad dressings or just added a drizzle to a hot dish at the time of serving.<br><br>Unfiltered', 'Olive varieties', 'Blend: picual, arbequina, génovèse and blanquette', 'a-amasel-ieltt', 98),
(151, 'fr', 'ao eFtrNi uo-vtniar', 'Guarena, Badajoz, Espagne', '500 ml', 'Saveurs', 'Une grande huile artisanale au fruité vert et au nez complexe. Onctueuse au goût prononcé, elle laisse peu d\'amertume et de piquant dans son arrière-goût.', 'Savoirs', 'Superbe avec les laitues amères, tel que : les endives, le radicchio, le cresson et la roquette (arugula).<br><br>Non filtrée', 'Variétés d\'olives', 'Monovariétale : frantoio', 'natuiianvrto-freo', 99),
(152, 'en', '-u naeaoNrrFivi tot', 'Guarena, Badajoz, Spain', '500 ml', 'Flavours', 'An exquisite artisanal oil with medium fruity aromas reminiscent of red apple and green grass. The palate is smooth and ends on a slight bitterness.', 'Flair', 'Superb on bitter lettuce, like endives, radicchio, cress and arugula.<br><br>Unfiltered', 'Olive varieties', 'Monovarietal: frantoio', 'nveuni-ooratriatf', 99),
(153, 'fr', 'd éi è- vXannrnuré ePzlU siVo DomaXzi e aegirdei', 'Jerez, Andalousie, Espagne', '250 ml', 'Saveurs', 'Vinaigre très aromatique avec des notes douces du vin Pedro Ximénez.', 'Savoirs', 'Il est idéal pour mariner, dresser les plats et pour l\'utilisation dans les desserts.', '', '', '-reenixvdarzi-oe-sieu--dinegrmloauneeox-dapv-i', 100),
(154, 'en', 'yrodePrmXevnegnvizi in  Uhi ézeo  raslDa-r', 'Jerez, Andalusia, Spain', '250 ml', 'Flavours', 'Very aromatic vinegar with sweet nuances from Pedro Ximénez wine.', 'Flair', 'It is great for marinating, dressing dishes and for using on desserts.', '', '', 'emgndvierrh-oieeponzr-yseiva-xa-rni-dolu', 100),
(155, 'fr', 'oe Sd eb0eraa0 vnsonigeVnu g-nr5i CTrari et', 'Cordoue, Andalousie, Espagne', '500 ml', 'Saveurs', 'Il est de couleur rouge foncé avec des reflets rouge brique et dispose d\'un arôme intense de pain grillé et de confiture.', 'Savoirs', 'Ce vinaigre si particulier est obtenu à partir de nos vins rouges de Cabernet Sauvignon, élevé dans nos fonds de cuve acétiques. Il est vieilli en barriques de chêne pendant 12 mois, et acquiert ainsi ses qualités exceptionnelles.<br><br>Idéal pour déglacer des sauces ou faire des assaisonnements.', '', '', '-rnnsnrtue0-tir-egaa5a-b-gcds0vieneooevir', 101),
(156, 'en', 'r tni e0erSorabVg05TeC uir-ena vosnn ga', 'Cordoba, Andalusia, Spain', '500 ml', 'Flavours', 'It is dark red in colour with brick-red tinges and has a notable, intense aroma of toast and marmalade.', 'Flair', 'This unique vinegar is obtained from red Cabernet Sauvignon grapes, raised in acetic drums, then aged in oak barrels for 12 months... an exceptional vinegar.<br><br>Ideal for deglazing sauces or making seasonings.', '', '', 'n0-ecs-u-trsogbvnovrain0tr-enar5gaeie', 101),
(157, 'fr', ' Vasac-HladnosLaiseal b j', 'Puente Genil, Cordoue, Espagne', '500 ml', 'Saveurs', 'Huile douce et fruitée qui rappelle l\'odeur du plant de tomates et le goût d\'amandes - finale équilibrée avec une note d\'amertume et de piquant.', 'Savoirs', 'Pour les salades de laitue et tomate. Excellente dans les ragoûts de viande, avec le thon grillé, les légumes grillés et les viandes au BBQ.<br><br>Non filtrée', 'Variétés d\'olives', 'Monovariétale : hojiblanca', '-lonbsvdlasasaijlaceha-', 102),
(158, 'en', 'Le d iasa naslcHoa-alsVbj', 'Puente Genil, Cordoba, Spain', '500 ml', 'Flavours', 'Sweet and fruity aromas that recall the odor of tomato plants and the taste of white almonds - very well balanced between bitterness and pungency.', 'Flair', 'For the classical tomato and lettuce salad. Excellent in meat stews, with grilled tuna, grilled vegetables and BBQ meat.<br><br>Unfiltered', 'Olive varieties', 'Monovarietal: hojiblanca', 'lsoabl-csneaaaj-hsavldi', 102),
(159, 'fr', 's L -slaVlPsdaeaiacu ', 'Puente Genil, Cordoue, Espagne', '500 ml', 'Saveurs', 'Un parfum fruité qui rappelle l\'odeur de foin frais - une huile de caractère avec une amertume et un goût poivré très apprécié par les hommes!', 'Savoirs', 'Idéale avec des légumes sautés et les gaspachos. Excellente avec le pain. Essayez-la aussi dans les sauces pour pâtes!<br><br>Non filtrée', 'Variétés d\'olives', 'Monovariétale : picual', 'daep-illua-calvssas', 103),
(160, 'en', 'uaissL a VldsPl caa-e', 'Puente Genil, Cordoba, Spain', '500 ml', 'Flavours', 'Green fruity aromas that are reminiscent of fresh hay - Picual has character with noticeable bitterness and pungency - Men love it!', 'Flair', 'Ideal with stirfried vegetables and gazpacho. Excellent with bread. Try it also in pasta sauces!<br><br>Unfiltered', 'Olive varieties', 'Monovarietal: picual', 'aaisslsp-alc-euldva', 103),
(161, 'fr', 'oediajoVñr An', 'Haro, Rioja, Espagne', '200 ml', 'Saveurs', 'C\'est un excellent vinaigre parfumé qui peut servir à la préparation de plusieurs plats. Il est superbe pour la préparation de vinaigrettes.', 'Savoirs', 'Ce vinaigre unique et de qualité supérieure donne un bouquet très parfumé. Le mot \"añejo\" fait référence au mot âgé. Ce vinaigre est fait exclusivement avec du vin de Rioja et vieillit pendant 2 ans dans des barils de chêne américain.', '', '', 'vaia-edrnonjo', 104),
(162, 'en', 'oA Vdnreiaojñ', 'Haro, Rioja, Spain', '200 ml', 'Flavours', 'Vindaro Añejo is flavourful, smooth and aromatic, ideal ingredients for any culinary use. It is an essential ingredient for the kitchen pantry.', 'Flair', '\"Añejo\" means old or aged. . This exclusive vinegar is aged two years in American oak barrels. Genuine 100% pure wine vinegar, produced with local wines. Refined and matured for two years in oak, it achieves an exquisite bouquet worthy of the most demanding palate.', '', '', 'j-dovanaroien', 104),
(163, 'fr', 'u teretAgap euSC ao-l', 'Baena, Cordoue, Espagne', '500 ml', 'Saveurs', 'Issu de trois fruits distincts, ce grand cru est d\'un fruité intense et complexe qui plaira aux connaisseurs de bonnes huiles!', 'Savoirs', 'Suerte Alta peut être utilisée dans plusieurs plats préparés avec des légumes. Son goût relèvera aussi les plats cuisinés à base de poisson.<br><br>Biologique - Filtrée - D.O.P. Baena', 'Variétés d\'olives', 'Assemblage : picudo, hojiblanca et picual', 'ceaest-ut-upeaolgra', 105),
(164, 'en', 'olauu-p trteCSeA e ag', 'Baena, Cordoba, Spain', '500 ml', 'Flavours', 'Made from three distinct olives, this special blend has an intense fruity perfume, sure to please olive oil lovers and connoisseurs!', 'Flair', 'Suerte Alta is a versatile oil that can be used in many vegetable dishes. It will also enhance fish and seafood preparations.<br><br>Organic - Filtered - D.O.P. Baena', 'Olive varieties', 'Blend: picudo, hojiblanca and picual', '-perltgeue-taoauasc', 105),
(165, 'fr', 'tPe-i ASarlae ult uc', 'Baena, Cordoue, Espagne', '500 ml', 'Saveurs', 'Produite tôt en novembre, cette huile au fruité vert intense révèle des arômes d\'olive fraîche, de tomate et d\'amande - amertume subtile et finale agréable.', 'Savoirs', 'Excellente avec le pain! Suerte Alta peut être utilisée dans plusieurs plats préparés avec des légumes. Son goût relèvera aussi les plats cuisinés à base de poisson.<br><br>Biologique - Filtrée - D.O.P. Baena', 'Variétés d\'olives', 'Monovariétale : picual', 'psutulaica-ate-elr', 106),
(166, 'en', 'Pcau Sel auite A-rtl', 'Baena, Cordoba, Spain', '500 ml', 'Flavours', 'Harvested in early November, this oil has an intense fruity green perfume with notes of fresh olives, tomatoes and almonds - subtle bitterness and peppery aftertaste!', 'Flair', 'Excellent with bread! Suerte Alta is a versatile oil that can be used in many vegetable dishes. It will also enhance fish and seafood preparations.<br><br>Organic - Filtered - D.O.P. Baena', 'Olive varieties', 'Monovarietal: picual', 'ueeutirctp-asaal-l', 106),
(167, 'fr', 'laciezstesn', 'Els Torms, Lleida, Espagne', '500 ml', 'Saveurs', 'Produite avec des variétés autochtones, cette huile unique révèle un fruité intense aux notes d\'artichauts, de bananes vertes et de fines herbes.', 'Savoirs', 'Idéale en salade, avec les poissons, sur les pâtes et légumes variés.<br><br>Biologique - Non filtrée', 'Variétés d\'olives', 'Assemblage : arbequina, arbreblanque et verdial', 'tlisnsaceeo', 107),
(168, 'en', 'tlceiszsane', 'Els Torms, Lleida, Spain', '500 ml', 'Flavours', 'Produced with indigenous varieties of olives, this unique oil has intense fruitiness of artichoke, green banana peel and fresh herbs. Excellent!', 'Flair', 'Great on salads, fish, pasta and vegetables.<br><br>Organic - Unfiltered', 'Olive varieties', 'Blend: arbequina, arbreblanque and verdial', 'seosnilceat', 107),
(169, 'fr', 'oeaeldM', 'Mornag, Tunisie', '500 ml', 'Saveurs', 'Au nez, les arômes rappellent l\'olive très fraîche. Son goût est doux-amer et se termine sur une note moyennement poivrée. Unique et savoureuse!', 'Savoirs', 'Elle est parfaite pour toutes sortes de salades, avec le poisson ou tout simplement seule avec le pain.<br><br>Filtrée', 'Variétés d\'olives', 'Monovariétale : chetoui', 'maoleed', 108),
(170, 'en', 'Maeedlo', 'Mornag, Tunisia', '500 ml', 'Flavours', 'Medolea is characterised by its fresh, intense fruity taste that ends with a pleasant bitterness and peppery pungent note. Unique and delicious!', 'Flair', 'Excellent fresh oil for various salads, fish and ideal with daily bread for a healthy diet.<br><br>Filtered', 'Olive varieties', 'Monovarietal: chetoui', 'eoeamld', 108),
(171, 'fr', 'ovo   de eeg\'  ldcelc trvxr\'ialethhuPilseeàaroeil', 'Montréal, Canada', '40 g', 'Saveurs', 'Perles de chocolat noir à l\'huile d\'olive extra vierge Olive & Olives 1.', 'Savoirs', 'Servir avec l\'apéro, au dessert ou les manger tout simplement pour se faire plaisir.', '', '', 'dexorir-e--lcaeeahl-gelid-pturc-iletvhesa-evo--lo', 109),
(172, 'en', 'iaoeEellrooiongcaplev tsl v  riati hcrx', 'Montreal, Canada', '40 g', 'Flavours', 'Dark chocolate pearls made with extra virgin olive oil Olive & Olives 1.', 'Flair', 'Serve with cocktails, dessert or simply enjoy them on their own.', '', '', 'laroacveoxng-oi-ilpvroetl--ceh-riislaet', 109),
(173, 'fr', 'vev-luvllz e1 eieNsz    i&uleoHil', 'Moli dels Torms, Lleida, Espagne', '500 ml', 'Saveurs', 'Fruité vert aux arômes de gazon fraîchement coupé avec des notes de pelure de banane et d\'amandes - douce et légèrement poivrée. Savoureuse!', 'Savoirs', 'L\'huile d\'olive Nouvelle Olive & Oilves 1 est produite avec les premières récoltes d\'octobre. Notre maître du moulin, monsieur Venanci Guiu, vous concocte l\'huile nouvelle au fruité vert mordant.<br><br>Biologique - Non filtrée', 'Variétés d\'olives', 'Assemblage : arbequina et arbreblanque', 'llulh1o-esnl--iveieeev-oilouv', 110),
(174, 'en', 'zl1 -ewleiHea s zv vievNrts & ', 'Moli dels Torms, Lleida, Spain', '500 ml', 'Flavours', 'Fruity green with aromas of fresh cut grass and notes of banana peel and almonds - mild and slightly peppery. Fresh and tasty!', 'Flair', 'New Harvest extra virgin olive oil is produced exclusively with the October crops. Our olive mill master, Mister Venanci Guiu, has made this special blend which is a strong green fruity oil. Ideal for connoisseurs and curious epicureans who would appreciate a fresh olive!<br><br>Organic - Unfiltered', 'Olive varieties', 'Blend: arbequina and arbreblanque', 'n-aveehtr-1wovvel-los-siei', 110),
(175, 'fr', 'ooainresMt', 'Tulebras, Navarre, Espagne', '500 ml', 'Saveurs', 'Une huile soyeuse et douce dont les arômes fruités évoquent les pousses de printemps et les jeunes olives. Pour amateurs d\'huile douce et goûteuse!', 'Savoirs', 'Délicieuse avec du pain, des salades, des poissons marinés, grillés ou au four. Dressez vos légumes frais ou cuits avec cette huile.<br><br>Non filtrée', 'Variétés d\'olives', 'Assemblage : arbequina et arroniz', 'tniosmoare', 111),
(176, 'en', 'etnsioMrao', 'Tulebras, Navarre, Spain', '500 ml', 'Flavours', 'A smooth and gentle oil which is fruit-forward with notes of fresh spring growths and olives. For connoisseurs of tasty and smooth oil.', 'Flair', 'Delicious with bread, salads, marinated, grilled or in the oven fish. Dress your fresh or cooked vegetables with this oil.<br><br>Unfiltered', 'Olive varieties', 'Blend: arbequina and arroniz', 'enramsotio', 111),
