(181, 'fr', 'e enPèoa-ems XXéVeu z gidi Franrr nearéeds ii', 'Sanlucar de Barrameda (Cadix), Espagne', '250 ml', 'Saveurs', 'Vinaigre aigre-doux avec un arôme complexe qui conserve les arômes intenses et piquants de vinaigre de Xérès adouci par l\'ajout d\'une faible proportion du vin naturellement doux Pedro Ximérez. Complexe avec une grande persistance et une douceur atténuée.', 'Savoirs', 'Idéal pour les assaisonnements, salades, macérations, escabèches, réductions, gibiers, poissons et légumes.<br><br>Couleur acajou foncé.', '', '', 'id-mfrpxgar-eai-rnsen-dieeee-veuei-anxzeosr', 114),
(182, 'en', ' h aoniSréz yXemeVneePsn iriaer rFeg-dr', 'Sanlucar de Barrameda (Cadix), Spain', '250 ml', 'Flavours', 'Sweet and sour vinegar with a complex aroma that preserves intense and pungent aromas of sherry vinegar smoothed by the addition of a small proportion of Pedro Ximérez natural sweet wine. Complex with great persistence and attenuated mildness.', 'Flair', 'Ideal in dressings, salads, macerations, marinades, reductions, game dishes, fish and vegetables.<br><br>Colour dark mahogany.', '', '', 'rp-rnmzniyexridenseav-r--ieeaegsforhe', 114),
(183, 'fr', 'oei aso ig-Xe euirrlinséaebin dFèregV q', 'Sanlucar de Barrameda (Cadix), Espagne', '250 ml', 'Saveurs', 'Notes piquantes typiques du vinaigre de Xérès combinées à un arôme de chêne. Persistant en bouche et élégant lors du passage.', 'Savoirs', 'Recommandé pour les salades, vinaigrettes, sauces, marinades, réductions, plats de gibier et de poisson.<br><br>Couleur délicate marron acajou.', '', '', '-xrglodira--iisbiqeavnsneeio-eefeeurg', 115),
(184, 'en', ' na gVsryhaigSei-eznr  reiraerFnc', 'Sanlucar de Barrameda (Cadix), Spain', '250 ml', 'Flavours', 'Typical pungent notes from Sherry Vinegar combines with an oak aroma. Persistent on palate and elegant when passing through.', 'Flair', 'Recommended in salads, vinaigrettes, dressings, marinades, reductions, game dishes and fish.<br><br>Colour delicate chestnut-mahogany.', '', '', 'saeniefiiaregr-roseyh-n-nrrgacv', 115),
(185, 'fr', '.X.inzniétceade ai gDsrVS vr  èeo-e ', 'Ferreira de Alentejo, Portugal', '250 ml', '', '', 'Savoirs', 'Vieilli en fût de chêne selon la méthode traditionnelle de \"soleras\".<br><br>Un excellent vinaigre pour rehausser les salades ou déglacer les viandes.', '', '', 'sxcretaioinivr-gde-eon-ae-vee-d-s', 117),
(186, 'en', 'ra DVrz.rh t nSiaycegiSV  e.e-neo', 'Ferreira de Alentejo, Portugal', '250 ml', '', '', 'Flair', 'Aged in oak barrels in the traditional \"soleras\" method.<br><br>Excellent vinegar for salads and for deglazing meats.', '', '', 'hrosroyecgeasnre-nvetda--vii--', 117),
(187, 'fr', 'pnâsCro', 'La Rioja, Espagne', '314 ml', '', '', 'Savoirs', 'Si on ne cueille pas le bouton du câprier on obtient la fleur qui est comestible. Confits dans le vinaigre.<br><br>À utiliser dans la préparation des tartares, avec le poisson et en sauce.', 'Conseil', 'Rincer au besoin.', 'aropscn', 118),
(188, 'en', 'sepbirCreera', 'La Rioja, Spain', '314 ml', '', '', 'Flair', 'If the caper bud is not picked, it flowers and produces a fruit called a caperberry. Preserved in vinegar.<br><br>Use in salads, on fish and smoked salmon.', 'Advice', 'Rinse if necessary.', 'cirearrbeesp', 118),
(189, 'fr', 'pCreâs', 'Navarre, Espagne', '212 ml', '', '', 'Savoirs', 'Bouton à fleur du câprier qui sert d\'assaisonnement. Les câpres sont confits dans le vinaigre.<br><br>Utiliser dans la préparation des tartares, avec le poisson et en sauce.', 'Conseil', 'Rincer au besoin.', 'cesrpa', 119),
(190, 'en', 'aCpers', 'Navarre, Spain', '212 ml', '', '', 'Flair', 'The caper is the bud of the caper bush. Preserved in vinegar.<br><br>Use in salads, on fish and smoked salmon.', 'Advice', 'Rinse if necessary.', 'raepcs', 119),
(191, 'fr', 'Glauniisld', 'La Rioja, Espagne', '314 ml', 'Saveurs', 'Piment vert d\'Espagne. Sa peau fine, sa chaire tendre qui ne pique pratiquement pas, sa couleur jaune-vert et sa saveur douce sont les caractéristiques d\'un piment unique en son genre.', 'Savoirs', 'Conservé dans du vinaigre de vin blanc peu acide et de faible teneur en sel, ce met exquis gagne de la reconnaissance sur le marché, non seulement comme accompagnement des plats, mais comme la base d\'une grande variété d\'apéritifs.<br><br>On le sert en apéro avec un filet d\'huile d\'olive extra vierge et quelques flocons de fleur de sel. Excellent avec la bière! Il est délicieux avec les saucisses, légumes grillés et dans les salades. On peut aussi le servir avec le poulet et les poissons de viande blanche.', '', '', 'luadslgini', 120),
(192, 'en', 'anGiilduls', 'La Rioja, Spain', '314 ml', 'Flavours', 'Green pepper from Spain. Its fine skin, its soft pulpit that is practically not spicy, its yellow-green color and sweet flavor, are the characteristics that make this hot pepper unique.', 'Flair', 'Preserved in soft white wine vinegar and low in salt, this exquisite dish is gaining recognition in the market, not only as an accompaniment to dishes but also as the basis of a wide variety of appetizers.<br><br>It is served as an aperitif with a drizzle of extra virgin olive oil and a few flakes of Fleur de sel. Great with beer! It is delicious with sausages, grilled vegetables and salads. It can also be served with chicken and white meat fish.', '', '', 'lngsldauii', 120),
(193, 'fr', 'm -maePuinL arug', 'Fuente de Piedra, Malaga, Espagne', '500 ml', 'Saveurs', 'Au fruité intense provenant d\'olives autochtones vidueño, cette huile révèle un nez complexe aux arômes de feuilles et d\'artichaut. Belle découverte!', 'Savoirs', 'Spécialement utilisée pour des recettes à base de poisson tel que de la morue salée, sauté de palourdes, crevettes avec sauce à l\'ail, anchois au vinaigre... Idéal pour cuire des oeufs, le ragoût et pour la préparation de salade ce qui ajoute un petit goût piquant.<br><br>Filtrée', 'Variétés d\'olives', 'Monovariétale : vidueño', 'mugal-nmuiarep', 121),
(194, 'en', 'u arL maimgueP-n', 'Fuente de Piedra, Malaga, Spain', '500 ml', 'Flavours', 'This oil gets its intense aromas from the indigenous vidueño olives and shows grassy notes of artichoke. A great find!', 'Flair', 'With fish dishes such as salted cod, sautéed clams, prawns in garlic sauce, anchovies in vinegar... Ideal for frying eggs, stews and salads.<br><br>Filtered', 'Olive varieties', 'Monovarietal: vidueño', 'inaeupmumgr-la', 121),
(195, 'fr', ' iracAo nàihgu\'ellèe taagen  -séVrtLn', 'Charente Maritime, France', '250 ml', '', '', 'Savoirs', 'Laurent Agnès compte 6 à 8 mois d\'élaboration, entre le moment où le vin est versé dans un fût de chêne et la mise en bouteille d\'un vinaigre de vin nature.<br><br>Pour cuisiner : pour la réalisation des beurres rouges sur les poissons. Pour assaisonner : sur les huîtres, salades vertes, salades de lentilles, mojhettes (haricot blanc), haricots verts et crudités.', '', '', 'ga-toc-ieirnetghnaale-aeaenlu--rlsv', 122),
(196, 'en', 'aèLgl ovat-s ASahrlenr n nigute', 'Charente Maritime, France', '250 ml', '', '', 'Flair', 'Laurent Agnès takes 6 to 8 months to make his vinegar from the time the wine is poured into an oak barrel until it is bottled.<br><br>For cooking: in reduction: to make red wine butter for fish. For seasoning: on oysters, green salad, lentil salad, mojette beans, green beans and veggies.', '', '', '-gna-a-eavioeetnrrsnutallhslg', 122),
(197, 'fr', 'a ofeVlAnietma arabèi rngusgr L eà nis-', 'Charente Maritime, France', '250 ml', '', '', 'Savoirs', 'Ingredients: wine vinegar, raspberry (20% of raspberries were macerated in vinegar before bottling).<br><br>For tasting: as an appetizer: drizzle on slices of toasted bread topped with goat\'s cheese. For seasonning: on avocado shrimp and mushrooms salad without mustard and with an unflavoured oil. For cooking : salmon en papillotte (2 teaspoons).', '', '', 'insefenr--iomnalua-a-eagbvlr-istargea', 123),
(198, 'en', 'e vrr anuag-èsrbneenripga ARts yL', 'Charente Maritime, France', '250 ml', '', '', 'Flair', 'Composition : Vinaigre de vin, framboise (20% de fruits ayant macéré dans le vinaigre avant mise en bouteille).<br><br>À déguster : en entrée : un filet sur les toasts de fromage de chèvre. En assaisonnement : salades d\'avocats, crevettes et champignons, sans moutarde, avec une huile neutre. En cuisson : saumon en papillote (2 cuillères à café).', '', '', 'nyrneiletrgrsrreab-puva-aseagn-', 123),
(199, 'fr', 'tgasuings rraeiucses -nV  naL èaAi', 'Charente Maritime, France', '250 ml', '', '', 'Savoirs', 'Laurent Agnès compte 6 à 8 mois d\'élaboration, entre le moment où le vin est versé dans un fût de chêne et la mise en bouteille d\'un vinaigre de vin nature.<br><br>Composition : vinaigre de vin, cassis fruit (30 % de fruits ayant macéré dans le vinaigre avant la mise en bouteille)', '', '', 't-sausgneiasgn-seirnlicrv-aaaue-', 124),
(200, 'en', 'tugrAsLe an- èn', 'Charente Maritime, France', '', '', '', '', 'Laurent Agnes takes 6 to 8 months to make his vinegar from the time the wine is poured into an oak barrel until it is bottled.<br><br>Ingredients: wine vinegar, cassis (30% of cassis were macerated in vinegar before bottling).', '', '', 'auegaletnnrs-', 124),
(201, 'fr', 'o  e i ,le sn arVeta-àigleanelArancrf\'geliotnLgreugènn ts ', 'Charente Maritime, France', '250 ml', '', '', 'Savoirs', 'Composition : Vinaigre de vin blanc, estragon frais, cannelle, clou de girofle, poivre noir (parfum obtenu exclusivement par macération).<br><br>À déguster : impérativement sur les huîtres fraîches (il laisse s\'exprimer l\'iode), pour la mouclade : incorporé à la crème fraîche après avoir évacué le jus de mer, sur les omelettes : un filet en fin de cuisson.', '', '', 'i-asorrnilleoaat-al-elrc-gegne-nlgnsevfuaar-e--tngneite', 125),
(202, 'en', 'n anngonè tLnrc srvml tTiuwhAaoodecgean vi-r e aia grann', 'Charente Maritime, France', '250 ml', '', '', 'Flair', 'Ingredients: white wine vinegar, fresh tarragon, cinnamon, cloves, black pepper (aroma only comes from maceration).<br><br>For tasting: Without a doubt on fresh oysters (allow the flavour to express itself). For mouclade: add to crème fraîche with strained liquid. On an omelette: drizzle when almost cooked.', '', '', 'n-n-nticgdtan--nenawvlauoag-lmnegherrii-covetor-anaasr', 125),
(203, 'fr', 'zsevrtpolm leeseie rin', 'El Masroig, Espagne', '220 g', 'Saveurs', 'Olive à chair douce préparée selon la méthode artisanale.', 'Savoirs', 'L\'olive empletre peut être utilisée dans les salades, dans les pâtes, pizzas, canapés et avec les hors-d\'œuvre.', 'Variétés d\'olives', 'Olives empeltre avec noyau', 'rstslloevenie-pe-ieomr', 126),
(204, 'en', 'vileloescBt aelkpr em', 'El Masroig, Spain', '220 g', 'Flavours', 'Smooth and sweet olive prepared by traditional methods.', 'Flair', 'Empeltre olives are excellent to dress salads, with pasta and to garnish pizzas. Also ideal to serve with canapés.', 'Olive varieties', 'Empeltre olives with pit', 'lebvcal--teeimkeprlos', 126),
(205, 'fr', 'zsascrosvéioe o lcnmnes', 'El Masroig, Espagne', '220 g', '', '', 'Savoirs', 'Si vous êtes un amateur d\'ail, vous pouvez mettre deux ou trois gousses d\'ail à l\'intérieur du pot une fois qu\'il est ouvert. Vous vous rendrez compte que l\'olive concassée obtiendra un léger goût d\'ail très rapidement.<br><br>Les olives concassées moron peuvent être servies tel quel ou pour accompagner l\'appéritif.', 'Variétés d\'olives', 'Olives moron avec noyau', 'o-lra-vonesnieocsoemssc', 127),
(206, 'en', 'olkoMebrn ensro ovi', 'El Masroig, Spain', '220 g', '', '', 'Flair', 'If you are a garlic lover, you can put two or three raw garlic cloves inside the jar once it is opened. The olives will get a soft garlic taste quite rapidly.<br><br>The broken moron olive can be eaten as a snack or served with vegetables dishes. Excellent for dressing salads.', 'Olive varieties', 'Moron olives with pit', 'oror-iseonolvmn-bke', 127),
(207, 'fr', 'rvlld isegoaz', 'El Masroig, Espagne', '220 g', 'Saveurs', 'Olive charnue avec un léger goût épicé et préparée selon la méthode artisanale.', 'Savoirs', 'Sa grosseur est idéale pour servir comme simple bouchée et pour garnir les martinis.', 'Variétés d\'olives', 'Olives gordal avec noyau', 'liogdsrv-laeo', 128),
(208, 'en', 'oGloravlised ', 'El Masroig, Spain', '220 g', 'Flavours', 'Served in a spicy brine using tradionnal methods.', 'Flair', 'This is a big spicy olive that can be used in appetizers and served with martinis. It is a very tasty olive that can be served on its own as a snack.', 'Olive varieties', 'Gordal olives with pit', 'gerovallidos-', 128),
(209, 'fr', 'codosisrti oLrG Saa', 'Ombrie, Italie', '500 ml', 'Saveurs', 'Vert émeraude aux reflets dorés, agréablement piquante avec un arrière-goût légèrement amer. Arômes fortement fruité avec un arrière-goût frais d\'olives vertes récemment pressées.', 'Savoirs', 'Idéale pour assaisonner rôtis de viande rouge, bruschetta et soupes de légumes.<br><br>Filtrée - D.O.P. Umbria', 'Variétés d\'olives', 'Assemblage : moraiolo (60 %), frantoio, leccino', 'alcrtsa-gooro-diiss', 129),
(210, 'en', 'GotSLosrir sd iacao', 'Umbria, Italy', '500 ml', 'Flavours', 'Emerald green with hints of gold, pleasantly spicy with a slightly bitter aftertaste. Intense fruity aroma with a fresh taste of freshly pressed, not fully ripe olives.', 'Flair', 'Particulary suited to dress roasted red meats, bruschetta and legume soups.<br><br>Filtered - D.O.P. Umbria', 'Olive varieties', 'Blend: moraiolo (60%), frantoio, leccino', 'doa--lcgtsrosrsaiio', 129),
(211, 'fr', 'tarGCnsnairideae sa', 'Spoleto, Ombrie, Italie', '500 ml', 'Saveurs', 'La famille Gradassi nous livre ici son grand cru; une huile agréablement amère au fruité intense et au goût pétillant d\'olives fraîches. Un « must » pour les connaisseurs!', 'Savoirs', 'Particulièrement adaptée pour bruschettas, salades d\'été et pour garnir les légumes grillés.<br><br>Filtrée', 'Variétés d\'olives', 'Assemblage : moraiolo, frantoio et leccino', 'srasaa-trneedagicni', 130),
