(213, 'fr', 'ilui zlgGmloei', '', '', 'Saveurs', 'Arôme intense d\'amandes fraîches avec des notes de tomates et légumes. Les frères Guglielmi nous servent une huile de terroir au caractère italien!', '', 'Cette huile se prête à plusieurs plats.<br><br>Filtrée - D.O.P. Tera di Bari', 'Variétés d\'olives', 'Monovariétale : coratina', 'lomliglg-uoiie', 131),
