(215, 'fr', '- e8v.l5Li esv z i 2z &l', 'Estepa, Séville, Espagne', '2.5 L', 'Saveurs', 'Fruité intense dominé par des arômes de tomates fraîches - bel équilibre entre l\'amertume et le piquant en finale.', 'Savoirs', 'Idéale avec salades, poisson, légumes et viandes grillées.<br><br>Filtrée - D.O.P. Estepa', 'Variétés d\'olives', 'Monovariétale : hojiblanca', '--lv-vios-e8-oli5le2', 132),
(216, 'en', 'v-zL.ziv5&esl 8  e2 li  ', 'Estepa, Seville, Spain', '2.5 L', 'Flavours', 'Intense fruitiness with fresh tomato aromas - a nice balance between spiciness and bitterness.', 'Flair', 'Ideal with salads, fish, grilled meats and veggies.<br><br>Filtered - D.O.P. Estepa', 'Olive varieties', 'Monovarietal: hojiblanca', 'e--5l-el8vsv-ii-o2lo', 132),
(217, 'fr', ' eF éVè-iu rrtegsacMn aieud senrXais a', 'Région de Xérès, Cadix, Espagne', '250 ml', 'Saveurs', 'Au nez: intense, fort, raisins et prunes, pruneau et des notes boisées. Saveur aigre-douce, vraiment aromatique.', 'Savoirs', 'Il peut être utilisé comme substitut pour le vinaigre balsamique. Ce vinaigre de dégustation aigre-doux est caractérisé par un condiment doux et subtil. Il est particulièrement recommandé pour les poissons, les fruits de mer et les desserts.<br><br>Couleur ambre, clair et brillant.', '', '', 'nriev-afaeadc-xmertserseu-ignui-se-a', 133),
(218, 'en', 'MeFer-  i geu Svasenrarctiyhasnr', 'Jerez region, Cadix, Spain', '250 ml', 'Flavours', 'Nose: intense, sharp, raisin and plum, with prune and wood incense  notes. Sweet and sour flavour, really aromatic.', 'Flair', 'It can be used as a substitute of balsamic. This bittersweet tasting vinegar is characterized by a gentle and subtle condiment. It is especially recommended for fish, seafood dishes and desserts.<br><br>Colour amber, clean and shining.', '', '', 'veniees-gfcrstirrhseauray-anm-', 133),
(219, 'fr', 'irenio yPrdVe l', 'Baena, Cordoue, Espagne', '500 ml', 'Saveurs', 'Fruité intense qui laisse une saveur de feuille verte en bouche. Très fraîche avec des notes d\'agrumes et d\'amandes en finale.', 'Savoirs', 'Superbe pour les vinaigrettes et pour arroser les légumes grillés! Cette huile est aussi excellente avec le pain.<br><br>Non filtrée - D.O.P. Baena', 'Variétés d\'olives', 'Assemblage : picudo et arbequina', 'ri-nyero-lviedp', 134),
(220, 'en', 'nryoVi er Pldei', 'Baena, Cordoba, Spain', '500 ml', 'Flavours', 'Intense fruitiness with a flavor of fresh grass with citrus and almond notes at the end.', 'Flair', 'Great for salad dressings and for grilled vegetables! This oil is also excellent with bread.<br><br>Unfiltered - D.O.P. Baena', 'Olive varieties', 'Blend: picudo and arbequina', 'riolvyedr-pe-in', 134),
(221, 'fr', 'guLana', 'Fuente de Piedra, Malaga, Espagne', '500 ml', 'Saveurs', 'Variété rarement utilisée pour la production d\'huile, cette olive nous donne un fruité intense et très vert - pour curieux et amateurs.', 'Savoirs', 'Spécialement utilisé pour des recettes à base de poisson tel que de la morue salée, sauté de palourdes, crevettes avec sauce à l\'ail, anchois au vinaigre. Idéal pour cuire des oeufs, le ragoût et préparation de salade qui ajoute un petit goût piquant.<br><br>Filtrée', 'Variétés d\'olives', 'Monovariétale : manzanilla', 'gnaual', 135),
(222, 'en', 'nagLua', 'Fuente de Piedra, Malaga, Spain', '500 ml', 'Flavours', 'This variety is not popular in olive oil production and stands on its own with a unique intense and green fruitiness - for curious amateurs to discover!', 'Flair', 'With fish dishes such as salted cod, sautéed clams, prawns in garlic sauce, anchovies in vinegar. Ideal for frying eggs, stews and salads.<br><br>Filtered', 'Olive varieties', 'Monovarietal: manzanilla', 'nuagal', 135),
(223, 'fr', 'ridnaesaBll', 'La Rioja, Espagne', '100 g', 'Saveurs', 'Un oignon, une olive, un poivron rouge et un cornichon sur une brochette de bois.', 'Savoirs', 'Brochettes apéritives prêtes à servir.', '', '', 'lidsrelbaan', 136),
(224, 'en', 'erBslnidaal', 'La Rioja, Spain', '100 g', 'Flavours', 'Onion, olive, red pepper and pickel on a wooden skewer.', 'Flair', 'Aperitif skewers ready to serve.', '', '', 'idnblaesrla', 136),
(225, 'fr', 'luà ed ihes éTéeoehaslocimsems\'\'l-tvi ', 'La Rioja, Espagne', '110 g', 'Saveurs', 'Tomates semi-séchées à l\'huile d\'olive avec origan et persil.', 'Savoirs', 'Ces tomates sont idéales pour les repas de pâtes! Essayez-les aussi dans vos mijotés.', '', '', 'mvo--it-lsmuhaehl-eastcidloes-se--eeei', 137),
(226, 'en', 'i reea li -nmmldedoitosStioeoi v', 'La Rioja, Spain', '110 g', 'Flavours', 'Semi-dried tomatoes in olive oil with oregano and parsley.', 'Flair', 'These tomatoes are ideal for a pasta meal! Try them also in your casseroles.', '', '', 'v-iraoied-leteo-mdtsmloo-esni-ii', 137),
(227, 'fr', 'eeeiahl  umsAQeld', 'Monteagudo, Navarre, Espagne', '500 ml', 'Saveurs', 'Elle a un goût délicat, légèrement sucré et fruité avec une touche d\'herbes fraîches.', 'Savoirs', 'En seulement quelques heures, les olives sont cueillies, sélectionnées et lavées avec de l\'eau. Elles sont ensuite pressées immédiatement et l\'huile est stockée dans des conteneurs en acier inoxydable jusqu\'à ce que l\'huile soit mise en bouteille sur place. Ce processus garantit que l\'huile a un faible taux d\'acidité et maintient intégralement son arôme, sa saveur et ses propriétés nutritionnelles.<br><br>Elle est idéal sur tous les types de salades, les poissons et les viandes blanches grillés ou cuits à la vapeur. Les légumes doivent être sautés à haute température pour leur succulence.<br><br>Filtrée', 'Variétés d\'olives', 'Monovariétale : arbequina', 'aqleams-ehiedleu-', 138),
(228, 'en', 'da llsQi eeehmAeu', 'Monteagudo, Navarre, Spain', '500 ml', 'Flavours', 'It has a delicate, slightly sweet and fruity taste with a hint of fresh herbs.', 'Flair', 'In only a few hours the olives are picked, selected and washed with water. They are then pressed immediately and the oil is stored in stainless steel containers until it is bottled on the premises. This process ensures that the oil has a low acidity and fully maintains its aroma, flavour and nutritional properties.<br><br>It is ideal for dressing all types of salads, and for grilled or steamed white meat and fish. Vegetables should be sautéed at a high temperature when using this oil to retain their succulence.<br><br>Filtered', 'Olive varieties', 'Monovarietal: arbequina', 'hsdeqeu-lleeaia-m', 138),
