(241, 'fr', ' E \'vg  aelo emrv e Miiseaeienc tlluablrsogdnàvaruipal ee aerdahdlx', '', '', 'Saveurs', 'Faites votre propre huile vanillée avec cette huile d\'olive extra vierge au fruité vert et cette gousse de vanille Madépices de Madagascar.<br><br>S\'accompagne aussi bien avec vos desserts que vos mets salés. <br><br>Inclus:<br>• Olive & Olives 8 - Huile d\'olive extra vierge - 250 ml<br>• Madépices - 2 gousses de vanille Bourbon<br>• Huilier<br>• 1 recette', 'Savoirs', '* Pour obtenir plus de détails sur les produits, veuillez consulter la section Huiles d\'olive.', '', '', 'tei-sdhimlebr-eed-repnmgenr-eseaalavao-lal-c-avrdlve-auxi--gaulo-ie', 145),
(242, 'en', 'xl\'tadnvzlaiizier  Kiasic  ita daanVnlar glMsrgaV E', '', '', 'Flavours', 'Make your own vanilla flavored oil with this fresh green fruity extra virgin olive oil and this Madépices vanilla pod from Madagascar.<br><br>Will brilliantly accompany both desserts and salty dishes.<br><br>Includes:<br>• Olive & Olives 8 - Extra Virgin Olive Oil - 250 ml<br>• Madépices - 2 Bourbon Vanilla Pods<br>• Oil Bottle<br>• 1 Recipe', 'Flair', '* For more details on the products, please see the Olive Oils section.', '', '', 'nvg-ed-lirngxs-r-m-lviin-aac-otlrk-eiaaadlsaoiatiav', 145),
(243, 'fr', 'ata05-S 7nM aatr ', 'Santa Marta de los Barros, Badajoz, Espagne', '750 ml', 'Saveurs', 'Fruité mûr avec des notes de pomme rappelant les fruits secs tels que les amandes et les noix. Un bel équilibre.', 'Savoirs', 'Excellent produit pour la cuisine de tous les jours.<br><br>Filtrée', 'Variétés d\'olives', 'Assemblage : morisca et carrasqueña', 'aatat0n57a--rsm', 146),
