(245, 'fr', 'vr nGzeeéado ', 'Puente de Genave, Jaén, Espagne', '500 ml', 'Saveurs', 'La picual lui donne un parfum fruité et un goût à la fois frais et aromatique. On a l\'impression de mordre dans le fruit.', 'Savoirs', 'Excellente pour la cuisine de tous les jours!<br><br>Biologique - Filtrée', 'Variétés d\'olives', 'Monovariétale : picual', '-oova-nederge', 147),
