(247, 'fr', 'nt FitL-aioaonott r', 'Canalicchio di Collazonne, Pérouse, Italie', '500 ml', 'Saveurs', 'Tout de cette huile est 100 % artisanal - un jus d\'olive italien exceptionnel au fruité intense et une finale légèrement piquante. À découvrir!', 'Savoirs', 'Biologique - Non filtrée', 'Variétés d\'olives', 'Monovariétale : frantoio', 'ttnfa-iilntooroat', 148),
(248, 'en', 'FtoiiortLontat  -na', 'Canalicchio di Collazonne, Perugia, Italy', '500 ml', 'Flavours', 'Everything about this oil is artisanal - 100% italian olive juice with exceptional intense fruity aromas and a light peppery aftertaste. Very good!', 'Flair', 'Organic - Unfiltered', 'Olive varieties', 'Monovarietal: frantoio', 'oln-trtoiaatnfoit', 148),
(249, 'fr', 'rMLati oooat itl-no', 'Canalicchio di Collazonne, Pérouse, Italie', '500 ml', 'Saveurs', 'Issue du même terroir, Moraiolo est typique de la région et se distingue de sa soeur par son intensité au nez et en bouche.', 'Savoirs', 'Biologique - Non filtrée', 'Variétés d\'olives', 'Monovariétale : moraiolo', 'lmar-oatoiiotntlo', 149),
(250, 'en', 'nLi-aiotra Mtoo lot', 'Canalicchio di Collazonne, Perugia, Italy', '500 ml', 'Flavours', 'Produced in the same terroir, Moraiolo is typical of the area and differs  from its sister oil by its intensity both in aromas and in taste.', 'Flair', 'Organic - Unfiltered', 'Olive varieties', 'Monovarietal: moraiolo', 'ntimtorot-oolalia', 149),
(251, 'fr', 'A aMoLnr a jas-ial', 'Tarragone, Catalogne, Espagne', '250 ml', '', '', 'Savoirs', 'Huile d\'olive aromatisée à l\'ail est produite selon le procédé d\'extraction à froid en incorporant l\'ail directement avec les fruits. Cette huile contient les propriétés nutritives des deux ingrédients, soit les olives arbequina et l\'ail.<br><br>Recommandé pour les salades, le pain, les soupes, les pâtes, les plats cuisinés et pour toute préparation où on recherche un goût raffiné d\'ail.', 'Variétés d\'olives', 'Olives arbequina et ail', 'as-oaaran-ajillm', 150),
(252, 'en', 'iaj GM  oraL-naalrsac', 'Tarragona, Catalunya, Spain', '250 ml', '', '', 'Flair', 'High quality, aromatic oil with a slight garlic flavour obtained from pressing olives and garlic jointly at low temperatures. This oil combines the nutritional benefits of both ingrediens in one dressing.<br><br>Especially recommended for salads, toasts, soups, pasta, stews and other dishes you want to refine with garlic flavour.', 'Olive varieties', 'Arbequina olives and garlic', 'aiol-maracglarjsna-', 150),
(253, 'fr', 'M- rhCjionaalLa si a', 'Tarragone, Catalogne, Espagne', '250 ml', '', '', 'Savoirs', 'Huile d\'olive aromatisée au piment est produite selon le procédé d\'extraction à froid en incorporant le chili directement avec les fruits. Cette huile contient les propriétés nutritives des deux ingrédients, soit les olives arbequina et le chili.<br><br>Recommandé pour les pizzas, les viandes, les pâtes et tout plat où on veut rehausser avec un goût de chili.', 'Variétés d\'olives', 'Olives arbequina et chili', 'haianmljaar-cls-oi', 151),
(254, 'en', 'ie rsrahiaLaM  aeCjlnpppo -', 'Tarragona, Catalunya, Spain', '250 ml', '', '', 'Flair', 'High quality, aromatic oil with a slight chili flavour obtained from pressing olives and chilis jointly at low temperatures. This oil combines the nutritional benefits of both ingredients in one dressing.<br><br>Especially recommended for pizza, meat, pasta and all other dishes you want to spice up with a chili flavour.', 'Olive varieties', 'Arbequina olives and chili pepper', 'sp-m-aenrppahc-aajlieliro', 151),
(255, 'fr', 'a ojsM aLno rriCa-nat', 'Tarragone, Catalogne, Espagne', '250 ml', '', '', 'Savoirs', 'Huile d\'olive aromatisée au citron est produite selon le procédé d\'extraction à froid en incorporant le citron directement avec les fruits. Cette huile contient les propriétés nutritives des deux ingrédients, soit les olives arbequina et le citron.<br><br>Recommandé pour les poissons grillés, les sauces et pour toute préparation où on veut rehausser avec le goût du citron.', 'Variétés d\'olives', 'Olives arbequina et citron', 'ralcr-astinao-ajomn', 152),
(256, 'en', 'an-jMnoso  Leamaar L', 'Tarragona, Catalunya, Spain', '250 ml', '', '', 'Flair', 'High quality, aromatic oil with slight lemon flavour obtained from pressing olives and lemon jointly at low temperatures. This oil combines the nutritional benefits of both ingredients in one dressing.<br><br>Especially recommended for grilled fish, dressings and all other dishes you want to enhance with lemon flavour.', 'Olive varieties', 'Arbequina olives and lemon', 'oe-asmanao-lamrljn', 152),
(257, 'fr', 'raaaze-jLM sngan oar ', 'Tarragone, Catalogne, Espagne', '250 ml', '', '', 'Savoirs', 'Huile d\'olive aromatisée à l\'orange est produite selon le procédé d\'extraction à froid en incorporant l\'orange directement avec les fruits. Cette huile contient les propriétés nutritives des deux ingrédients, soit les olives arbequina et l\'orange.<br><br>Recommandé pour les salades, les viandes, le riz, le poisson et les plats nécessitant un zeste d\'orange. Excellente avec le chocolat.', 'Variétés d\'olives', 'Olives arbequina et orange', 'aegnra-onalmajsao-r', 153),
(258, 'en', 'gnzsajrL-aeona aM ra ', 'Tarragona, Catalunya, Spain', '250 ml', '', '', 'Flair', 'High quality, aromatic oil with a slight orange flavour obtained from pressing olives and orange jointly at low temperatures. This oil combines the nutritional benefits of both ingredients in one dressing.<br><br>Goes well with salads, meat, rice, fish and all other dishes, infusing them with a zest of orange. Especially recommanded for use with chocolate.', 'Olive varieties', 'Arbequina olives and orange', '-aeoanrjorgmnaalas-', 153),
(259, 'fr', 'lapzav ec“Ghisaz”', 'El Masroig, Espagne', '220 g', 'Saveurs', 'Ces olives sont aromatisées avec les aliments du gaspacho : oignons, piments, carottes et poivrons rouges.', 'Savoirs', 'Les olives peuvent être servies telles quelles ou pour accompagner l\'apéritif. Excellentes en salade.', 'Variétés d\'olives', 'Olive moron avec noyau', 'sovhca-azeialgp', 154),
(260, 'en', 'G“ovazpci”a lhesa', 'El Masroig, Spain', '220 g', 'Flavours', 'These olives are flavored with gazpacho ingredients: onions, peppers, carrots and red peppers', 'Flair', 'Can be eaten as a snack or served with vegetables dishes. Excellent for dressing salads.', 'Olive varieties', 'Moron olives with pit', 'i-aphlvozceasga', 154),
(261, 'fr', 'Czvaaallilza', 'Cazalla de la Sierra, Séville, Espagne', '500 ml', 'Saveurs', 'Assemblage complexe provenant des récoltes d\'oliviers de montagne, cette huile au caractère doux et peu ardente laisse peu d\'amertume en bouche.', 'Savoirs', 'Excellente avec les poissons, les fromages légers et les carpaccios. Également délicieuse, avec les desserts au chocolat et à la crème glacée.<br><br>Biologique - Filtrée', 'Variétés d\'olives', 'Assemblage : picolimon et manzanilla', 'ialzvllaaaco', 155),
