(263, 'fr', 'iglmo izeugGa-lnr eli z', 'Terre de Bari, Château du Mont, Italie', '250 ml', '', '', 'Savoirs', 'Huile d\'olive extra vierge aromatisée à l\'orange produite selon le procédé d\'extraction à froid en incorporant des oranges fraîches pendant le pressage. Un produit entièrement naturel!<br><br>Avec un parfum et une saveur incomparable, cette huile est excellente pour une marinade de poisson, pour la salade et le poisson grillé, idéal pour badigeonner une viande; surtout la viande de gibier. Parfaite pour la préparation de gâteaux et gourmandises.', 'Variétés d\'olives', 'Olives coratina et oranges', 'maelgunggleoi-ii-rolo', 156),
(264, 'en', 'a iegu-irlilmlo ngz ezG', 'Terra di Bari, Castel del Monte, Italy', '250 ml', '', '', 'Flair', 'First cold pressed of olives picked ripe and milled simultaneously with fresh oranges.<br><br>Use to enhance the flavour of marinades and sauces, salad recipes, grilled meat and fish, and to cook game meat. Excellent with pastries and baked food.', 'Olive varieties', 'Coratina olives and oranges', 'ugmogn-iloagleei-ilro', 156);
