(266, 'en', 'egGio oll-leii nLuzmm ', 'Terra di Bari, Castel del Monte, Italy', '250 ml', '', '', 'Flair', 'First cold pressed of olives picked ripe and milled simultaneously with fresh lemons. With its refined and unique taste, use it for uncooked dishes.<br><br>Drizzle over fish appetizers, salad recipes and dried beef. Also wonderful with vegetables, grilled meat and fish.', 'Olive varieties', 'Coratina olives and lemons', 'lmeouog-igino-mliell', 157),
