(279, 'fr', '0liue5Hr l mi0', 'Barcelone, Espagne', '', '', '', 'Savoirs', 'Ce huilier possède un bouchon avec un canal qui récupère la goûte non versée et qui se glisse à l\'intérieur.', 'Conseil', 'Le huilier doit toujours être lavé une fois vidé afin de s\'assurer de toujours consommer de l\'huile fraîche. Rincez-le avec du bicarbonate de soude et de l\'eau chaude avant de le laver avec du savon.', 'imerll--00h5iu', 164),
(280, 'en', 'v00oel zerz  lum liPi5r', 'Barcelona, Spain', '', '', '', 'Flair', 'This glass pourer with a lid has a pour spout designed in a way that the drop fall back into the pourer.', 'Advice', 'The pourer must always be washed once emptied from its content of oil. This assures that you to always have fresh olive oil. Rinse with baking soda and hot water before using soap. Rinse with hot clean water and let dry before filling.', 'o00--mvloe5iruirpleo--l', 164),
