(283, 'fr', 'lvilsv eie&zz  11', 'Andria, Les Pouilles, Italie', '500 ml', 'Saveurs', 'Cet assemblage permet d\'obtenir une huile aux arômes de fleur et d\'herbe fraîchement coupée, où dominent délicatesse et fraîcheur. Sa saveur est douce et agréable.', 'Savoirs', 'Excellente dans n\'importe quel plat, elle est particulièrement intéressante pour les crudités, en salades et dans les repas à base de poisson et de crustacés.<br><br>Filtrée', 'Variétés d\'olives', 'Assemblage : coratina, ogliarola et peranzana', 'l-v1ov1iieo-esl', 166),
(284, 'en', 'vezs1&  lvli1ze i', 'Andria, Puglia, Italy', '500 ml', 'Flavours', 'This blend provides a golden oil with a soft green hue. Mixed with aromas of flowers and fresly cut grass, it is delicate and fresh. It has a moderate intense fruity flavour.', 'Flair', 'Excellent for any course, particularly attractive approach is revealed with raw vegetables, salads and all fish dishes.<br><br>Filtered', 'Olive varieties', 'Blend: coratina, ogliarola and peranzana', 'ov1li-1ilsveo-e', 166),
(285, 'fr', 'eâ thsa e CrurteP au FtVn-seiéid', 'Tarascon, Provence, France', '375 ml', 'Saveurs', 'Arômes végétaux intenses : herbe fraîchement coupée et artichaut cru. La bouche est bien équilibrée entre fruité et vivacité. D\'une texture grasse et beurrée en attaque, elle s\'achève sur une finale poivrée et dynamisante.', 'Savoirs', 'Idéale pour une cuisine saine et gastronomique, cette huile valorisera vos divers plats chauds et froids; poissons, viandes, pâtes, salades, légumes vapeur…<br><br>Filtrée', 'Variétés d\'olives', 'Assemblage: aglandeau, bouteillan, verdale et salonenque', 'rndcuhse--e-eufavra-tsetptieai', 167),
(286, 'en', 'ue âtedFsGtr-h euas Praiein y nCe', 'Tarascon, Provence, France', '375 ml', 'Flavours', 'Intense bouquet reminiscent of freshly cut herbs and artichokes. The taste is well balanced between soft fruitiness and boldness. This oil begins with a subtle, buttery texture, and ends on a peppery and invigorating zenith.', 'Flair', 'It will elevate your various cold and hot dishes – fish, meat, pasta, salad, steamed vegetables…<br><br>Filtered', 'Olive varieties', 'Blend: aglandeau, bouteillan, verdale and salonenque', 'rdiaee-e--ugseshrnpfcu-taynteia', 167),
