(291, 'fr', 'eoeav  & tis nvzidlmbzilln n-ecC', 'Modène, Italie', '250 ml', '', '', 'Savoirs', 'Ce vinaigre est obtenu à partir de moût de raisins blancs acétifié et fermenté dans des tonneaux de Rouvre (chêne) de façon à ce qu\'il prenne une couleur jaune-or. La caractéristique la plus évidente de ce vinaigre est qu\'il ne modifie pas la couleur des mets et offre des arômes et des saveurs fruités délicatement acides (remplace à merveille le vinaigre de vin).<br><br>Excellent avec les salades, les légumes aussi bien crus que cuits, les sauces, les poissons, les viandes blanches, les fromages (mozzarella de buffalonne, Bitto, scamorza et robiola) et dans la préparation d\'apéritifs.', '', '', 'ioltcmsvinoec-n-ialnevdb-oel', 170),
(292, 'en', 'vd esoW ltz n lmvzt ieihi&e-iCne', 'Modena, Italy', '250 ml', '', '', 'Flair', 'It is produced using white grape must, which is acetified and matured in oak barrels. It has a typical yellow-gold colour. Its most striking feature is that it does not alter the colour of dishes but adds a fruity and mildly acid aroma and flavour (excellent in place of wine vinegar).<br><br>Ideal on: salad, raw and cooked vegetables, sauces, fish, white meat (chicken and turkey), cheese (buffalo Mozzarella, Bitto, Scamorza and Robiola), for aperitifs.', '', '', 'ien-oclinhosmtte-eod-ewivlvi', 170),
(293, 'fr', ' izseivzv lz& r3l ie', 'Modène, Italie', '250 ml', 'Saveurs', 'Agréablement doux, légèrement acidulé, avec des saveurs fruitées et veloutées, de moût de raisin cuit, des notes boisées avec des saveurs de moût de raisin cuit Trebbiano. Noir brillant avec des rayons jaunes et une densité sirupeuse. Son arôme a un côté subtil d\'aigre-doux.', 'Savoirs', 'Idéal sur les salades, les légumes aussi bien crus que cuits, les viandes grillées blanches ou rouges, les omelettes, les fromages, les poisons pochés ou grillés, les salades de fruits.', '', '', '-3sveoievi-ir-ooll', 171),
(294, 'en', 'vl3 eir i e& liszzzv', 'Modena, Italy', '250 ml', 'Flavours', 'Pleasantly sweet and slightly sour, with flavours of Trebbiano cooked grape must. Dark with bright yellow rays and a medium density.', 'Flair', 'This Balsamic Vinegar is ideal on mixed salads, raw or cooked vegetables, grilled white and red meat, omelette, cheese, poached and grilles fish and fruit salads.', '', '', 'voiril-levos3i--eo', 171),
(295, 'fr', 'iiizzvs evllr z e4& ', 'Modène, Italie', '250 ml', 'Saveurs', 'Noir brillant avec des rayons jaunes et de densité moyenne, ce balsamique a des arômes subtils d\'aigre-doux avec des notes boisées et des saveurs fruitées. Agréablement doux, légèrement acidulé.', 'Savoirs', 'Pour rehausser les légumes cuits sur la braise, grillés ou simplement cuits, le saumon fumé, la pizza, les risottos, les viandes rôties ou grillées, les poissons, les fromages, les salades de fruits, les yogourts et la crème glacée.', '', '', 'irl4esle-ooovv-i-i', 172),
