(317, 'fr', 'ai gürNgañeCe', 'Sierra de Gata, Cáceres, Espagne', '500 ml', 'Saveurs', 'Légèrement douce, équilibrée entre le piquant et l\'amertume. Elle se distingue par son goût fruité intense, offrant des arômes de banane, de pomme et d\'herbe fraîchement coupée.', 'Savoirs', 'Exquise avec les aliments crus et la plus appropriée pour les petits déjeuners, les vinaigrettes pour repas froids et tièdes, ainsi que pour les collations et les salades car elle offre un bouquet délicat rehaussant les saveurs de la nourriture avec laquelle elle est combinée.<br><br>Biologique - Non filtrée', 'Variétés d\'olives', 'Monovariétale : manzanilla cacereña', 'r-nuaeanggeic', 183),
