(321, 'fr', '10vuixosevca zne  ei& lzav y -l', 'Estrémadure, Espagne', '250 ml', 'Saveurs', 'Olives manzanillas avec noyaux.', 'Savoirs', 'Le goût naturel et fruité de l\'olive manzanilla qu\'on peut servir tel quel, avec un filet d\'huile d\'olive extra vierge ou mélanger avec des amandes, des lupins, du zeste d\'orange et rehaussé d\'un filet d\'huile d\'olive extra vierge aromatisée à l\'orange.', 'Conseil', 'Se conservent dans le garde-manger et peuvent être rafraîchies au frigo durant une demie heure avant de servir.', '0-oa-exoeav-neoc-1vyiuvills', 185),
(322, 'en', 'st sielivl1i-he   z z&iw0tpv ', 'Extremadura, Spain', '250 ml', 'Flavours', 'Manzanilla olives with pits.', 'Flair', 'The original and natural taste of manzanilla olives that can be served directly out of the tin! Drizzle a filet of extra virgin olive oil or mix with almonds, lupini beans and orange zest with some orange flavoured extra virgin olive oil.', 'Advice', 'Keep in a cupboard pantry then chill in the fridge for half an hour before serving.', '0ihoi--e1v-o-vsiptstllewi', 185),
