(333, 'fr', ' ueeQgdPials eo', 'Monteagudo, Navarre, Espagne', 'Bouteille de 500ml', 'Saveurs', 'Fruité intense, très fraîche, arômes de tomate et de pomme verte, quelques notes de banane et d\'amande.  Très douce en bouche avec un piquant en final qui tarde à se faire sentir et une amertume qui laisse croire à une huile parfaitement équilibrée.', '', '', 'Variétés d\'olives', 'Arbequina et arroniz', 'qoilupa-g-esdee', 191),
