(337, 'fr', 'ainiaCo  dAblnem', 'Hellin, Espagne', 'Bouteille de 500ml', 'Saveurs', 'Arôme intense de fruité, avec accent de gazon vert suivi d\'arôme de tomate, banane et une note d\'agrume. L\'intense goût  poivré disparaît rapidement pour faire place à une finale de noisette.<br>Une huile puissante et bien balancée.<br>', '', '', 'Variétés d\'olives', 'Arbequina et hojiblanca', 'mio-nen-ailbcaad', 195),
