(345, 'fr', 'eieeluiB czipt éo céoni-oSgsalq le -vl-e', 'Sigri, Lesvos, Grèce', '', 'Saveurs', 'Les oliviers ‘\'Adramitiani\'\' et ‘\'Kolovi\'\' sont exclusifs au terroir de Lesvos et ont un caractère unique. L\'assemblage de ces deux variétés d\'olives crée des arômes de pomme et de poire avec un arrière-goût d\'amande. Une huile fraîche et délicate.', 'Savoirs', 'Un excellent choix pour la cuisine de tous les jours, pour la cuisson ou la finition. <br><br>Filtrée<br>', 'Variétés d\'olives', 'Assemblage : Adramitiani et Kolovi', 'veegsolipi--ctbeoolnl-sea-qleiiecuoe', 200),
